const Footer = () => {
    return (
        <>
            <footer>
                <div className="footer-container">
                    <div className="footer-heading">Upify</div>
                        <div className="footer-content">
                            <a href="https://www.youtube.com/" target="/" className="footer-link">Our Email</a>
                            <a href="https://www.youtube.com/" target="/" className="footer-link">About Us</a>
                            <a href="https://www.youtube.com/" target="/" className="footer-link">Contact Us</a>
                            <a href="https://www.youtube.com/" target="/" className="footer-link">Terms and Conditions</a>
                            <a href="https://www.youtube.com/" target="/" className="footer-link">Our Team</a>
                            <a href="https://www.youtube.com/" target="/" className="footer-link">Privacy-policy</a>
                            <hr/> <hr/>
                        </div>
                    <div className="base-line">
                        Â© 2020, All rights reserved.
                    </div>
                </div>
            </footer>
        </>
    );
};

export default Footer;
